import './index.css';

function Cards() {
    return (
        <div className="mycards">
            <div className='card'>
                <h3 className='card-comment'>코멘트 들어갈 곳</h3>
                <p className='card-nickname'>- 닉네임</p>
            </div>
        </div>
    )
}
export default Cards
